  $(document).on('ready', function() {
    'use strict';
    var iconNum = localStorage.getItem("iconNum");
    var addNewIcon = function(num){
            var $newIcon = $('<button id="content">'+ localStorage.getItem("icon_" + num + "_name") +'</button>');
            $("#collected #icons").append($newIcon);
    };
    if( iconNum == null || (localStorage.getItem("reset") == 1 || localStorage.getItem("reset") == null)){
            localStorage.setItem("icon_1_name", "超星学习通");
            localStorage.setItem("icon_2_name", "中国大学 MOOC");
            localStorage.setItem("icon_3_name", "Wikipedia");
            localStorage.setItem("icon_4_name", "知网");
            localStorage.setItem("icon_5_name", "哔哩哔哩");
            localStorage.setItem("icon_6_name", "华为消费者业务官网");
            localStorage.setItem("icon_1_url", "http://i.mooc.chaoxing.com/space/index");
            localStorage.setItem("icon_2_url", "https://www.icourse163.org/");
            localStorage.setItem("icon_3_url", "https://www.wikipedia.org/");
            localStorage.setItem("icon_4_url", "https://www.cnki.net/");
            localStorage.setItem("icon_5_url", "https://www.bilibili.com/");
            localStorage.setItem("icon_6_url", "https://consumer.huawei.com/cn/");
            localStorage.setItem("icon_1_ico", "");
            localStorage.setItem("icon_2_ico", "");
            localStorage.setItem("icon_3_ico", "");
            localStorage.setItem("icon_4_ico", "");
            localStorage.setItem("icon_5_ico", "");
            localStorage.setItem("icon_6_ico", "");
            for(var i = 1; i <= 6;i++){
                addNewIcon(i);
                $("#collected #icons #content:nth-child("+ i +")").css({"background-image":"url(data:image/png;base64," + localStorage.getItem("icon_" + i + "_ico") +")"});
            }
            for(var i = 12; i > 6; i--){
            $(".border-layer:nth-child("+ i +")").remove();
            }
            var $newIcon = $('<button id="add">+</button>');
            var $newTemp = $('<button id="content" class="temp"></button>');
            $("#collected").append($newIcon);
            $("#collected #icons").append($newTemp);
            var x = $(".temp").position().top;
            var y = $(".temp").position().left;
            var px = $("#collected").position().top;
            var py = $("#collected").position().left;
            $(".temp").remove();
            $("#collected #add").css({"top": "calc(" + (x-px) +"px - 2.4vh + 16px)" , "left": "calc(" + (y+py) +"px - 24vw)"});
            $("#collected #add").css({"display":"none"});
            localStorage.setItem("iconNum", "6");
            $("#service").css({"display":"block","opacity":"1"});
            $("#service ul").css({"opacity":"1"});
    }
    else{

        for(var i = 1; i <= iconNum; i++){
            addNewIcon(i);
            $("#collected #icons #content:nth-child("+ i +")").css({"background-image":"url(data:image/png;base64," + localStorage.getItem("icon_" + i + "_ico") +")"});
        }
        for(var i = 12; i > iconNum; i--){
            $(".border-layer:nth-child("+ i +")").remove();
        }
        if( iconNum < 12){
            var $newIcon = $('<button id="add">+</button>');
            var $newTemp = $('<button id="content" class="temp"></button>');
            $("#collected").append($newIcon);
            $("#collected #icons").append($newTemp);
            var x = $(".temp").position().top;
            var y = $(".temp").position().left;
            var px = $("#collected").position().top;
            var py = $("#collected").position().left;
            $(".temp").remove();
            $("#collected #add").css({"top": "calc(" + (x-px) +"px - 2.4vh + 16px)" , "left": "calc(" + (y+py) +"px - 24vw)"});
            if(iconNum >= 6){
                $("#collected #add").css({"display":"none"});
            }
        }
    }
});